import React from 'react'
import { Input, Grid,Container, Card, Row, Text ,Spacer,Button} from "@nextui-org/react";
import { useFormik } from 'formik';
import * as Yup from 'yup';
import { useDispatch, useSelector } from 'react-redux';
import { Navigate } from 'react-router-dom';
import { loginManager } from '../redux/slices/managerSlices';

const formSchema=Yup.object({
  email:Yup.string().required('email required'),
  password:Yup.string().required('password is definetly required'),
})
const Login = () => {
  const dispatch=useDispatch();
  const user=useSelector((state)=>state?.users);
  const {loading,appErr,serverErr,userAuth}=user;
  // formik
  const formik=useFormik({
    initialValues:{
      firstName:'',
      lastName:'',
      email:'',
      password:'',
      dob:'',
      address:'',
      company:''
    },
    onSubmit:(values)=>{
    console.log(values);
    dispatch(loginManager(values));
    },
    validationSchema:formSchema
  });
  return (

  
    
    <div class='container mx-auto px-20 place-content-center bg-grey-400'>
    <div class="">
       <Container responsive gap={0} AlignItems = 'center' css={{ mw: "1000px" }}>
    
       <Card css={{$$cardColor: '$colors$#16181A', mw: "700px" ,bw:0}}>
        <Card.Header>
        <Text
            h1
            size={60}
            
            weight="bold"
          >
    Login
          </Text>
        </Card.Header>
            <Card.Body>
            <Spacer y={1} />
            
            
            <Spacer y={1.5} />
    
            <Input
              clearable 
              label="Email"
              placeholder="Enter your email address"
              color="secondary"
            />
            <Spacer y={1.5} />
            <Input
                        //   value={formik.values.password}
                        //   onChange={formik.handleChange("password")}
                        //   onBlur={formik.handleBlur("password")}
                          color="error"
                         
                          type="password"
                          label='Password'
                          placeholder="Enter Password"
                        />
            <Spacer y={1.5} />
            <Button shadow size="lg" color="secondary" auto>
          Login
            </Button>
            </Card.Body>
            </Card>
    
       </Container>
       
      
        </div>
        </div > 
  
  )
}

export default Login
